import React, { Component } from 'react'
import {Link ,BrowserRouter as Router} from 'react-router-dom';

export default class Nav extends Component {
  render() {
    return (
      <div>
        <ul>
        <Link to="/">Home</Link>
        <Link to="/aboutus">
            <li>About Us</li>
            </Link>
            <Link to="/shop">
            <li >Contact Us</li>
            </Link>
            <Link to="/contactus">
            <li >Contact Us</li>
            </Link>  
            </ul>
      </div>
    )
  }
}
